import React from "react";
import { Link } from "react-router-dom";
import "./BodyCream.css";
import creamImage from "../Image/exportImages";

class BodyCream extends React.Component {
  state = {
    urls: creamImage
  };
  renderImage(imageUrl) {
    return (
      <div id ="individualImage">
        <img src={imageUrl.urls} />
        <div id ="imageText">{imageUrl.text}</div>
      </div>
    );
  }
  render() {
    console.log(this.state.urls);
    return (
      <>
        <Link to="/">Go Home</Link>
          <div className="images">
            <div className="abc">
            {this.state.urls.map(img => this.renderImage(img))}
            </div>
          </div>
      </>
    );
  }
}

export default BodyCream;
